import React from 'react';

type IconProps = {|
  name:
    | 'image'
    | 'info'
    | 'blur'
    | 'bw'
    | 'sharpen'
    | 'invert'
    | 'cool'
    | 'benchmark'
    | 'undo'
    | 'download'
    | 'delete'
    | 'js'
    | 'toggle'
    | 'drag'
    | 'wasm'
    | 'github'
|};

export default function Icon({ name }: IconProps) {
  switch (name) {
    case 'image':
      return <IconImage />;
    case 'info':
      return <IconInfo />;
    case 'blur':
      return <IconBlur />;
    case 'bw':
      return <IconBW />;
    case 'sharpen':
      return <IconSharpen />;
    case 'invert':
      return <IconInvert />;
    case 'cool':
      return <IconCool />;
    case 'benchmark':
      return <IconBenchmark />;
    case 'undo':
      return <IconUndo />;
    case 'download':
      return <IconDownload />;
    case 'delete':
      return <IconDelete />;
    case 'js':
      return <IconJS />;
    case 'toggle':
      return <IconToggle />;
    case 'drag':
      return <IconDrag />;
    case 'wasm':
      return <IconWasm />;
    case 'github':
      return <IconGithub />;
    default:
      return null;
  }
}

